export default (function(a,b,c,d){return {data:{rbMNRM0IrO:{data:{id:871,attributes:{imdbId:"tt0061584",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMjMxOTM3NzU4M15BMl5BanBnXkFtZTgwNDU0MDUxMDE@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"6.2\u002F10"},{Source:"Rotten Tomatoes",Value:"27%"},{Source:"Metacritic",Value:"34\u002F100"}],item_lang:{data:{id:1534,attributes:{title:"Doctor Dolittle",plot:"Dr. John Dolittle lives in a small English village where he specializes in caring for and verbally communicating with animals. When Dr. Dolittle is unjustly sent to an insane asylum for freeing a lovesick seal from captivity, his animals and two closest human friends, Matthew Mugg and Tommy Stubbins, liberate him. Afterward, they join Emma Fairfax and set out by boat to find a famed and elusive creature: the Great Pink Sea Snail.",slug:"doctor-dolittle"}}},books:{data:[{id:5327,attributes:{title:d,description:"Designed to appeal to the booklover, the Macmillan Collector’s Library is a series of beautiful gift editions of much loved classic titles. Macmillan Collector’s Library are books to love and treasure. Doctor Dolittle is one of the most delightful and fascinating characters in children’s literature. This Macmillan Collector’s Library edition of The Story of Doctor Dolittle is illustrated with Hugh Lofting’s own drawings, and includes updated material and an afterword by author Philip Ardagh. Doctor Dolittle’s house in Puddleby-on-the-Marsh is full to the brim with eccentric characters, from Polynesia the parrot to Gub-Gub the pig. After learning the languages of all his animals, the gracious and kind-hearted doctor hears that the monkeys in Africa have become inflicted with a terrible disease. So with a team of trusty creatures by his side, the doctor sets sail on an action-packed adventure to save them.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=3cJQDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:true,published:"2018-09-06",publisher:"Pan Macmillan",subtitle:b}},{id:5328,attributes:{title:"The Story of Doctor Dolittle (HarperCollins Children’s Classics)",description:"This beautiful HarperCollins Children’s Classics edition is perfect for every bookshelf.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=uJxGEAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:c,published:"2022-02-03",publisher:"HarperCollins UK",subtitle:b}},{id:5329,attributes:{title:d,description:"Doctor Dolittle - the only man in the world who can talk to animals. In this classic story, the Doctor sets off on an exciting adventure in Africa and returns with the most amazing creature of all - the two-headed Pushmi-Pullyu.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=YF6oPwAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a,"Robin Preiss Glasser"],firstBook:c,published:"1999-01-01",publisher:"Vintage",subtitle:"Being the History of His Peculiar Life at Home and Astonishing Adventures in Foreign Parts, Never Before Printed"}},{id:5330,attributes:{title:"The Story of Dr Dolittle",description:"“After a while, with the parrot's help, the Doctor got to learn the language of the animals so well that he could talk to them himself and understand everything they said.” John Dolittle is a highly respected doctor in the village of Puddleby-on-the-Marsh, yet he loves animals so much that his house is soon full of them. With all his patients scared away, and the expense of feeding his menagerie mounting, a friend suggests that the Doctor become a vet instead. With the help of Polynesia the parrot, Doctor Dolittle swiftly learns the language of the animals so that he can talk to all of his new patients. However, when a message comes from Africa, telling of a terrible sickness among the monkeys there, the Doctor and his animal friends depart on a thrilling and dangerous adventure that they are never likely to forget.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=3WCctQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:c,published:"2020-01-14",publisher:"Alma Classics",subtitle:b}},{id:5331,attributes:{title:"The Voyages of Doctor Dolittle",description:"Doctor Dolittle heads for the high seas in perhaps the most amazing adventure ever experienced by man or animal. Told by nine-and-a-half-year-old Tommy Stubbins, crewman and future naturalist, the voyages of Doctor Dolittle and his company lead them to Spidermonkey Island. Along with his faithful friends, Polynesia the parrot and Chee-Chee the monkey, Doctor Dolittle survives a perilous shipwreck and lands on the mysterious floating island. There he meets the wondrous Great Glass See Snail who holds the key to the greatest mystery of all.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=3e8OAAAAYAAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:c,published:"1922-01-01",publisher:"Frederick A. Stokes",subtitle:b}}]}}},meta:{}}},prerenderedAt:1680940957208}}("Hugh Lofting","",null,"The Story of Doctor Dolittle"))